import Select from '@mui/material/Select';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Box from '@mui/material/Box';
import { useRef } from 'react';
interface Props{

}
export default function Time(props: Props){
    const Times = [
        undefined,
        15,
        30,
        45,
        60
    ]
    const [time, setTime] = useState<string | number>("No limit")

    return (
        <>
            <Box sx={{ minWidth: 120 }}>
                <FormControl fullWidth>
                    <InputLabel id="time">Timer</InputLabel>
                    <Select
                    labelId="time"
                    id="time"
                    label="Timer"
                    value={time.current}
                    onChange={(event)=>time.current = event.target.value}
                    >
                        {Times.map((time: number | undefined)=>{
                            return (
                                time ? 
                                <MenuItem value={time}>{time}s</MenuItem>
                                : 
                                <MenuItem defaultChecked={true} value="No Limit">No Limit</MenuItem>
                            )
                        })}
                    </Select>
                </FormControl>
            </Box>
        </>
    )
}
